    return (
        <div className="container-section">
            <div className="cash-back">
                <img src="" alt=""/>
                <h1>Cash Back</h1>                
            </div>

            <div className="cashback-img">
                <h1>Imagem celular</h1>
            </div>

            <div className="cash    back-simulation">
                <h1>simulador</h1>
            </div>
        </div>
    )
}
